import React from 'react';
import { List, ListItem, Checkbox, Avatar, ListItemButton, ListItemAvatar, ListItemText, Tabs, Tab } from '@mui/material';

export const TokenListItem = ({token}) => {
	return(
		<ListItem
		secondaryAction={
			<Checkbox
				edge="end"
			/>
		}
		disablePadding
	>
		<ListItemButton>
			<ListItemAvatar>
				<Box style={{backgroundColor: 'gray', textAlign: 'center'}}>
					{token.symbol}
				</Box>
			</ListItemAvatar>
			<ListItemText primary={token.name} sx={{marginLeft: '12px'}}/>
		</ListItemButton>
	</ListItem>
	)
}
